INSERT INTO `wptk_cky_cookie_categories` (`category_id`, `name`, `slug`, `description`, `prior_consent`, `visibility`, `priority`, `sell_personal_data`, `meta`, `date_created`, `date_modified`) VALUES
(1, '{\"en\":\"Necessary\"}', 'necessary', '{\"en\":\"<p>Necessary cookies are required to enable the basic features of this site, such as providing secure log-in or adjusting your consent preferences. These cookies do not store any personally identifiable data.<\\/p>\"}', 1, 1, 0, 1, '[]', '0000-00-00 00:00:00', '2023-04-06 12:23:19'),
(2, '{\"en\":\"Functional\"}', 'functional', '{\"en\":\"<p>Functional cookies help perform certain functionalities like sharing the content of the website on social media platforms, collecting feedback, and other third-party features.<\\/p>\"}', 0, 1, 0, 1, '[]', '0000-00-00 00:00:00', '2023-04-06 12:23:19'),
(3, '{\"en\":\"Analytics\"}', 'analytics', '{\"en\":\"<p>Analytical cookies are used to understand how visitors interact with the website. These cookies help provide information on metrics such as the number of visitors, bounce rate, traffic source, etc.<\\/p>\"}', 0, 1, 0, 1, '[]', '0000-00-00 00:00:00', '2023-04-06 12:23:19'),
(4, '{\"en\":\"Performance\"}', 'performance', '{\"en\":\"<p>Performance cookies are used to understand and analyze the key performance indexes of the website which helps in delivering a better user experience for the visitors.<\\/p>\"}', 0, 1, 0, 1, '[]', '0000-00-00 00:00:00', '2023-04-06 12:23:19'),
(5, '{\"en\":\"Advertisement\"}', 'advertisement', '{\"en\":\"<p>Advertisement cookies are used to provide visitors with customized advertisements based on the pages you visited previously and to analyze the effectiveness of the ad campaigns.<\\/p>\"}', 0, 1, 0, 1, '[]', '0000-00-00 00:00:00', '2023-04-06 12:23:19');
