(227, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:77:\"Introducing New Nested Elements - the Future of Design with Elementor widgets\";s:7:\"excerpt\";s:416:\"Elementor and Elementor Pro 3.10 include new design capabilities that will unlock a whole new world of creativity when it comes to designing your websites with Nested Elements, and introduces a new custom unit in sizing controls that will enable you to reach a higher level of accuracy when it comes to designing your websites. These versions also include a new container-based library, and performance improvements.\";s:7:\"created\";i:1674137711;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:137:\"https://elementor.com/blog/new-nested-elements-tabs-custom-units/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:98:\"Introducing Elementor 3.9: New Save as Default Option for Elements To Enhance Your Design Workflow\";s:7:\"excerpt\";s:253:\"Elementor 3.9 includes the new Save as a Default option, broadens the capabilities of the Loop Builder to support WooCommerce and the section-based layout, and several additional features that improve the design of your website and its user experience. \";s:7:\"created\";i:1670943042;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:141:\"https://elementor.com/blog/introducing-elementor-3-9-save-as-default/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:82:\"Introducing Loop Builder: Design Every Aspect of your Post and Product Collections\";s:7:\"excerpt\";s:306:\"Elementor 3.8 includes some highly anticipated features, including the first phase of the Loop Builder, with additional functions and capabilities added in upcoming versions. With the Loop Builder, you gain more creative freedom to design your posts and listings, so you can design it any way youd like.\";s:7:\"created\";i:1667397460;s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:128:\"https://elementor.com/blog/introducing-the-loop-builder/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
