(687, 'cky_banner_template', 'a:1:{s:2:\"en\";a:2:{s:4:\"html\";s:10034:\"<div class=\"cky-overlay cky-hide\"></div><div class=\"cky-btn-revisit-wrapper cky-revisit-hide\" data-cky-tag=\"revisit-consent\" data-tooltip=\"Cookie Settings\" style=\"background-color:#0056a7\"> <button class=\"cky-btn-revisit\" aria-label=\"Cookie Settings\"> <img src=\"https://ecommerce.nety.ma/wp-content/plugins/cookie-law-info/lite/frontend/images/revisit.svg\" alt=\"Revisit consent button\"> </button></div><div class=\"cky-consent-container cky-hide\"> <div class=\"cky-consent-bar\" data-cky-tag=\"notice\" style=\"background-color:#FFFFFF;border-color:#f4f4f4;color:#212121\">  <div class=\"cky-notice\"> <p class=\"cky-title\" data-cky-tag=\"title\" style=\"color:#212121\">We value your privacy</p><div class=\"cky-notice-group\"> <div class=\"cky-notice-des\" data-cky-tag=\"description\" style=\"color:#212121\"> <p>We use cookies to enhance your browsing experience, serve personalized ads or content, and analyze our traffic. By clicking \"Accept All\", you consent to our use of cookies.</p> </div><div class=\"cky-notice-btn-wrapper\" data-cky-tag=\"notice-buttons\"> <button class=\"cky-btn cky-btn-customize\" aria-label=\"Customize\" data-cky-tag=\"settings-button\" style=\"color:#1863dc;background-color:transparent;border-color:#1863dc\">Customize</button> <button class=\"cky-btn cky-btn-reject\" aria-label=\"Reject All\" data-cky-tag=\"reject-button\" style=\"color:#1863dc;background-color:transparent;border-color:#1863dc\">Reject All</button> <button class=\"cky-btn cky-btn-accept\" aria-label=\"Accept All\" data-cky-tag=\"accept-button\" style=\"color:#FFFFFF;background-color:#1863dc;border-color:#1863dc\">Accept All</button>  </div></div></div></div></div><div class=\"cky-modal\"> <div class=\"cky-preference-center\" data-cky-tag=\"detail\" style=\"color:#212121;background-color:#FFFFFF;border-color:#F4F4F4\"> <div class=\"cky-preference-header\"> <span class=\"cky-preference-title\" data-cky-tag=\"detail-title\" style=\"color:#212121\">Customize Consent Preferences</span> <button class=\"cky-btn-close\" aria-label=\"[cky_preference_close_label]\" data-cky-tag=\"detail-close\"> <img src=\"https://ecommerce.nety.ma/wp-content/plugins/cookie-law-info/lite/frontend/images/close.svg\" alt=\"Close\"> </button> </div><div class=\"cky-preference-body-wrapper\"> <div class=\"cky-preference-content-wrapper\" data-cky-tag=\"detail-description\" style=\"color:#212121\"> <p>We use cookies to help you navigate efficiently and perform certain functions. You will find detailed information about all cookies under each consent category below.</p><p>The cookies that are categorized as \"Necessary\" are stored on your browser as they are essential for enabling the basic functionalities of the site. </p><p>We also use third-party cookies that help us analyze how you use this website, store your preferences, and provide the content and advertisements that are relevant to you. These cookies will only be stored in your browser with your prior consent.</p><p>You can choose to enable or disable some or all of these cookies but disabling some of them may affect your browsing experience.</p> </div><div class=\"cky-accordion-wrapper\" data-cky-tag=\"detail-categories\"> <div class=\"cky-accordion\" id=\"ckyDetailCategorynecessary\"> <div class=\"cky-accordion-item\"> <div class=\"cky-accordion-chevron\"><i class=\"cky-chevron-right\"></i></div> <div class=\"cky-accordion-header-wrapper\"> <div class=\"cky-accordion-header\"><button class=\"cky-accordion-btn\" aria-label=\"Necessary\" data-cky-tag=\"detail-category-title\" style=\"color:#212121\">Necessary</button><span class=\"cky-always-active\">Always Active</span> <div class=\"cky-switch\" data-cky-tag=\"detail-category-toggle\"><input type=\"checkbox\" id=\"ckySwitchnecessary\"></div> </div> <div class=\"cky-accordion-header-des\" data-cky-tag=\"detail-category-description\" style=\"color:#212121\"> <p>Necessary c